import React from "react";

import { Container, Repository } from "./styles.js";

const CompareList = ({ repositories }) => (
  <Container>
    {repositories.map((repositories) => {
      <Repository>
        <header>
          <img
            src={repositories.owner.avatar_url}
            alt={repositories.owner.login}
          />
          <strong>{repositories.name}</strong>
          <small>{repositories.owner.login}</small>
        </header>

        <ul>
          <li>
            {repositories.stargazers_count}
            <small>starts</small>
          </li>
          <li>
            {repositories.forks_count}
            <small>forks</small>
          </li>
          <li>
            {repositories.open_issues_count}
            <small>issues</small>
          </li>
          <li>
            {repositories.pushed_at}
            <small>last commit</small>
          </li>
        </ul>
      </Repository>;
    })}
  </Container>
);

export default CompareList;
